import React,{Component} from "react";

class  InputPage extends Component{
    constructor(props){
        super(props);
        this.state = {
            name: "User"
        }

    }
    displayWelcome=() =>
        <h3>    HELLO {this.state.name}</h3>

    render(){
        return(

         <input type="text" placeholder="Enter your name" className="personalinput" onFocus={displayWelcome} ></input>

        );
    }

}

export default InputPage;
